    <dl class=term>
      <dt class="term__item">NONE</dt>
      <dd class="term__desc"><span lang="ja">非圧縮形式です。</span><span lang="en">Uncompressed format.</span></dd>
      <dt class="term__item">ZIP</dt>
      <dd class="term__desc"><span lang="ja">ZIP形式です。</span><span lang="en">ZIP format.</span></dd>
      <dt class="term__item">GZIP</dt>
      <dd class="term__desc"><span lang="ja">GZIP形式です。</span><span lang="en">GZIP format.</span></dd>
      <dt class="term__item">UNKNOWN</dt>
      <dd class="term__desc"><span lang="ja">未知の値です。</span><span lang="en">Unknown Value</span></dd>
    </dl>
